create table company
(
    id                 bigint auto_increment
        primary key,
    company_type       varchar(32)            null comment '企业类型',
    company_name       varchar(255)           null comment '企业名称',
    brand_name         varchar(64)            null comment '品牌名称',
    corporate          varchar(32)            null comment '法人',
    logo               bigint                 null comment '公司LOGO',
    business_license   bigint                 null comment '公司营业执照',
    social_credit_code varchar(64)            null comment '社会信用代码',
    address            varchar(255)           null comment '地址',
    profile            varchar(300)           null comment '公司简介',
    company_phone      varchar(20)            null comment '联系电话',
    wallet_address     varchar(64)            null comment '钱包地址',
    create_time        datetime               null,
    create_by          varchar(32)            null,
    update_time        datetime               null,
    update_by          varchar(32)            null,
    status             tinyint(1) default 1   null comment '状态 1：启用  2：禁用',
    audit_status       tinyint(1) default 1   null comment '审核状态 1：待审核，2：已审核',
    audit_time         datetime               null comment '审核时间',
    private_key        varchar(2550)          null comment '私钥',
    audit_by           varchar(32)            null comment '审核人',
    code               varchar(16)            null comment '邀请码',
    is_send            varchar(2) default 'N' null comment '是否发送',
    send_time          datetime               null comment '发送时间'
)
    charset = utf8;

